(() => {
  function createCometExplosionAnimation({
    ctx,
    canvas,
    startX,
    startY,
    endX,
    endY,
    startTime,
    scale = 1,
  }) {
    const duration = 800;
    const explosionDuration = 400;

    const SCALE = scale;

    const img = new Image();
    img.src =
      "data:image/png;base64,";
    let imgLoaded = false;
    img.onload = () => {
      imgLoaded = true;
    };
    img.onerror = () => {
      console.error("Image failed to load");
    };

    const orbitRadius = 20 * SCALE;
    const orbitSpeed = 0.01;
    const numComets = 3;

    let cometHistories = Array.from({ length: numComets }, () => []);

    return (now) => {
      const elapsed = now - startTime;
      const flightProgress = Math.min(elapsed / duration, 1);

      ctx.clearRect(0, 0, canvas.width, canvas.height);

      if (flightProgress < 1) {
        const centerX = startX + (endX - startX) * flightProgress;
        const centerY = startY + (endY - startY) * flightProgress;

        const coreRadius = (3 + flightProgress * 3) * SCALE;

        const orbitAngle = elapsed * orbitSpeed;

        for (let i = 0; i < numComets; i++) {
          const offsetAngle = orbitAngle + i * ((2 * Math.PI) / numComets);
          const cometX = centerX + Math.cos(offsetAngle) * orbitRadius;
          const cometY = centerY + Math.sin(offsetAngle) * orbitRadius;

          cometHistories[i].push({ x: cometX, y: cometY });
        }

        // Draw the spiraling tails for each comet.
        for (let i = 0; i < numComets; i++) {
          const history = cometHistories[i];
          for (let j = 1; j < history.length; j++) {
            // Draw each segment of the tail with faster fading opacity.
            const alpha = Math.pow(j / history.length, 2);
            ctx.strokeStyle = `rgba(0, 150, 255, ${alpha})`;
            ctx.lineWidth = 6 * SCALE;
            ctx.beginPath();
            ctx.moveTo(history[j - 1].x, history[j - 1].y);
            ctx.lineTo(history[j].x, history[j].y);
            ctx.stroke();
          }
        }

        // Draw the cores for each comet.
        for (let i = 0; i < numComets; i++) {
          const history = cometHistories[i];
          if (history.length > 0) {
            const { x: cometX, y: cometY } = history[history.length - 1];

            const coreGradient = ctx.createRadialGradient(
              cometX,
              cometY,
              0,
              cometX,
              cometY,
              coreRadius + 6 * SCALE,
            );
            coreGradient.addColorStop(0, "rgba(255, 255, 255, 1)");
            coreGradient.addColorStop(0.4, "rgba(0, 150, 255, 1)");
            coreGradient.addColorStop(1, "rgba(0, 150, 255, 0.2)");

            ctx.fillStyle = coreGradient;
            ctx.beginPath();
            ctx.arc(cometX, cometY, coreRadius + 6 * SCALE, 0, Math.PI * 2);
            ctx.fill();
          }
        }

        return true;
      }

      // ---- explosion phase ----
      const explosionElapsed = elapsed - duration;
      const explosionProgress = Math.min(
        explosionElapsed / explosionDuration,
        1,
      );

      // Draw a scaling image at the end position.
      const maxSize = 200 * SCALE;
      const currentSize = explosionProgress * maxSize;
      const alpha = 1 - explosionProgress;

      if (imgLoaded) {
        ctx.globalAlpha = alpha;
        ctx.drawImage(
          img,
          endX - currentSize / 2,
          endY - currentSize / 2,
          currentSize,
          currentSize,
        );
        ctx.globalAlpha = 1;
      }

      return explosionProgress < 1;
    };
  }
  const canvas = document.createElement("canvas");
  canvas.width = Math.min(window.innerWidth, 900);
  canvas.height = Math.min(window.innerHeight, 500);

  canvas.style.cssText = `
    position: fixed;
    left: 16px;
    bottom: 16px;
    z-index: 999999;
    border-radius: 12px;
    background: rgba(0,0,0,.65);
    backdrop-filter: blur(2px);
    box-shadow: 0 12px 40px rgba(0,0,0,.35);
  `;

  document.body.appendChild(canvas);

  const ctx = canvas.getContext("2d");

  function runOnce(endX, endY) {
    const startX = 40;
    const startY = canvas.height - 40;

    const scale = Math.max(0.8, Math.min(2, canvas.width / 700));

    const startTime = performance.now();
    const tick = createCometExplosionAnimation({
      ctx,
      canvas,
      startX,
      startY,
      endX,
      endY,
      startTime,
      scale,
    });

    let rafId = 0;
    const loop = (now) => {
      const alive = tick(now);
      if (alive) rafId = requestAnimationFrame(loop);
    };
    rafId = requestAnimationFrame(loop);

    return () => cancelAnimationFrame(rafId);
  }

  let stopCurrent = runOnce(canvas.width * 0.8, canvas.height * 0.3);

  const onClick = (e) => {
    const rect = canvas.getBoundingClientRect();
    const x = (e.clientX - rect.left) * (canvas.width / rect.width);
    const y = (e.clientY - rect.top) * (canvas.height / rect.height);

    stopCurrent?.();
    stopCurrent = runOnce(x, y);
  };

  canvas.addEventListener("click", onClick);

  window.__COMET_DEMO__ = {
    stop() {
      stopCurrent?.();
    },
    destroy() {
      stopCurrent?.();
      canvas.removeEventListener("click", onClick);
      canvas.remove();
      delete window.__COMET_DEMO__;
    },
    rerun() {
      stopCurrent?.();
      stopCurrent = runOnce(canvas.width * 0.8, canvas.height * 0.3);
    },
  };

  console.log(
    " Comet demo started. Click the canvas to aim. Controls: __COMET_DEMO__.stop(), __COMET_DEMO__.rerun(), __COMET_DEMO__.destroy()",
  );
})();
